import { Button, TextField } from "@mui/material";
import React from "react";

export default function SearchPanel() {
  return (
    <>
      <TextField id="outlined-basic" label="Outlined" variant="outlined" />
      <Button variant="contained">Search</Button>
    </>
  );
}
